  [],\n\t\"revision_timestamp\": \"2016-07-27T22:20:18.617546\",\n\t\"name\": \"stillwater-wildlife-management-area-including-stillwater-national-wildlife-refuge-annual-n\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Stillwater
  NWR and WMA, Fallon NWR, and Anaho Island NWR outlines Refuge accomplishments during
  the 1986 calendar year. The report begins with a summary of the year's highlights
  and weather conditions. Land acquisition is covered. The report includes a planning
  section which discusses compliance with environmental and cultural resource mandates
  and research and investigations. Refuge administration is outlined; information
  about personnel, youth programs, volunteer programs, funding, safety, and technical
  assistance is given. Habitat management is also covered; subjects include wetlands,
  croplands, grasslands, grazing, fire management, and water rights. The wildlife
  section of the report discusses wildlife diversity, endangered and threatened species,
  waterfowl, marsh birds and waterbirds, shorebirds, raptors, game mammals, fisheries
  resources, scientific collections, and disease control. The public uses of the Refuge
  described in this report include interpretive programs, hunting, fishing, trapping,
  wildlife observation, outdoor recreation, and law enforcement. The equipment and
  facilities section of the report provides information about rehabilitation and major
  maintenance. Cooperative programs and items of interest are provided at the end.
  Newspaper articles are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
